    [],nt"num_tags": 7,nt"name": "rattlesnake-creek-management-program-proposal",nt"isopen":
    false,nt"url": null,nt"notes": "The Partnership has concentrated its efforts
    on a voluntary approach for lowering the total water use in the Rattlesnake Creek
    subbasin. This will occur through the use of the new management alternatives, an
    information/education program implemented simultaneously, and an enhanced compliance
    and enforcement effort. The primary mechanism to reach the goals of the management
    program is to reduce the total amount of water used in the subbasin through these
    methods, especially in those areas identified as priority areas. This design should
    result in the stabilization and reversal of the declining groundwater trends and
    enhanced streamflows.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
